import React from "react";
import "./button.css";

const Button = ({text, img}) => {
    const handleClick= () => {
        alert("Button Clicked!");
    };

    return (
        <button onClick={handleClick}>
            {text}
            <img src={img} />
        </button>
    );
}

export default Button;
